The State of Florida has failed to distribute expanded unemployment benefits in this COVID-19 crisis to more than 1 million residents.

The @USDOL has a responsibility to hold the state of Florida’s administration accountable.

@RonWyden and I are demanding an investigation NOW! https://t.co/CZYhwnO22I

To President Trump

@SpeakerPelosi and I are calling on you to immediately reopen Lafayette Square

Lafayette Square should be a symbol of freedom and openness, not a place behind which the leader of our Executive Branch cowers in fear of protesters who are crying out for justice https://t.co/Od8BrI8mAW
